@charlesccychen thanks for the feedback. I've updated the PR to read and write the files in chunks according to the `gcsio` default settings.

Tested with the same script as before where `myfile.txt` is a 54MB file (the buffer seems to be 8 and 16MB for reading and writing, so that should be a few chunks). The sha256 sum is identical for `myfile.txt` and `myfile2.txt` (i.e. after re-fetching the file) so it looks like it's working.

What do you think?
